import React, {useState} from 'react';


function Project({title,img, id}) {


    return (




        <li className="project" key={id}>

                <img src={img} alt="Project img" className="project__img"/>
                <h3 className="project__title">{title}</h3>
            
        </li>
    );
}

export default Project;
